import React, { useState } from "react";
import axios from "axios";
import { toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import "./AddRecipe.css"; // Import the new CSS file

const AddRecipe = () => {
  const [formData, setFormData] = useState({
    name: "",
    description: "",
    image: "",
    price: "",
  });

  const [loading, setLoading] = useState(false);

  // Handle input change
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: name === "price" ? value.replace(/[^0-9.]/g, "") : value, // Restrict non-numeric input for price
    }));
  };

  // Validate form data
  const isFormValid = () => {
    const { name, description, image, price } = formData;
    if (!name || !description || !image || !price) {
      toast.error("Please fill in all fields.");
      return false;
    }
    return true;
  };

  // Handle form submission
  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!isFormValid()) return;

    setLoading(true);
    const token = localStorage.getItem("token");

    if (!token) {
      toast.error("Unauthorized: No token found! Please log in.");
      setLoading(false);
      return;
    }

    try {
      console.log("Submitting Data:", formData);
      const response = await axios.post(
        "http://localhost:6409/api/Recipestores",
        { ...formData, price: parseFloat(formData.price) },
        {
          headers: {
            "Content-Type": "application/json",
            Authorization: `Bearer ${token}`,
          },
        }
      );

      console.log("Server Response:", response.data);

      if (response.status === 201) {
        toast.success("Recipe added successfully!");
        setFormData({ name: "", description: "", image: "", price: "" });
      }
    } catch (error) {
      console.error("Error adding recipe:", error.response?.data || error);
      toast.error(error.response?.data?.message || "Failed to add recipe");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="recipe-container">
      <h2 className="recipe-title">Add a New Recipe</h2>
      <form onSubmit={handleSubmit} className="recipe-form">
        {/* Recipe Name Input */}
        <InputField
          label="Recipe Name"
          type="text"
          name="name"
          value={formData.name}
          placeholder="Enter recipe name"
          onChange={handleInputChange}
        />

        {/* Description Input */}
        <TextAreaField
          label="Description"
          name="description"
          value={formData.description}
          placeholder="Enter recipe description"
          onChange={handleInputChange}
        />

        {/* Image URL Input */}
        <InputField
          label="Image URL"
          type="text"
          name="image"
          value={formData.image}
          placeholder="Enter image URL"
          onChange={handleInputChange}
        />

        {/* Price Input */}
        <InputField
          label="Price"
          type="text"
          name="price"
          value={formData.price}
          placeholder="Enter recipe price"
          onChange={handleInputChange}
        />

        <button type="submit" className="recipe-button" disabled={loading}>
          {loading ? "Submitting..." : "Submit Recipe"}
        </button>
      </form>
    </div>
  );
};

/**
 * Input Field Component
 */
const InputField = ({ label, type, name, value, placeholder, onChange }) => (
  <div className="recipe-input-group">
    <label className="recipe-label">{label}</label>
    <input
      type={type}
      name={name}
      value={value}
      onChange={onChange}
      placeholder={placeholder}
      className="recipe-input"
      required
    />
  </div>
);

/**
 * Text Area Field Component
 */
const TextAreaField = ({ label, name, value, placeholder, onChange }) => (
  <div className="recipe-input-group">
    <label className="recipe-label">{label}</label>
    <textarea
      name={name}
      value={value}
      onChange={onChange}
      placeholder={placeholder}
      className="recipe-textarea"
      required
    />
  </div>
);

export default AddRecipe;
